import React from "react";

import "./App.css";

function App() {
  return (
    <div className="form-group row">
      <label for="inputEmail3" className="col-sm-2 col-form-label">
        Email
      </label>
      <div className="col-sm-10">
        <input
          type="email"
          className="form-control"
          id="inputEmail3"
          placeholder="Email"
        />
      </div>
    </div>
  );
}

export default App;
